import React from 'react';
import styled from 'styled-components';
import TextInput from '../../../components/textInput/index';

export const Highlights = () => {
  const highlightsArr = [
    'highlight1',
    'highlight2',
    'highlight3',
    'highlight4',
    'highlight5',
  ];
  const highlights = highlightsArr.map((item, index) => {
    return (
      <TextInput
        key={item}
        identifier={item}
        labelWidth='1.35rem'
        width='100%'
        labelHeader={`${index + 1}`}
      />
    );
  });
  return (
    <TextRow>
      {' '}
      Highlights:
      {highlights}
    </TextRow>
  );
};

const TextRow = styled.div`
  display: flex;
`;
